/*Table structure for table `device_station` */

DROP TABLE IF EXISTS `device_station`;

CREATE TABLE `device_station` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '主键ID',
  `station_mac` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '设备mac地址',
  `screen_mac` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '显示器mac',
  `area_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '区域ID',
  `school_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学校id',
  `category` int(11) DEFAULT NULL COMMENT '基站种类：1校门口2公共区域3班级',
  `class_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '班级id',
  `class_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '教室名称',
  `type` int(10) DEFAULT NULL COMMENT '基站类型【0扫描数据，1计算发送数据】',
  `status` int(10) DEFAULT '0' COMMENT '设备状态[0:正常, 1:异常]',
  `step_frequency` int(11) DEFAULT '0' COMMENT '步行频率（一天扫描次数）',
  `sleep_frequency` int(11) DEFAULT '0' COMMENT '睡眠频率（一天扫描的次数）',
  `position_cycle` int(11) DEFAULT '0' COMMENT '位置基站的扫描周期（毫秒）',
  `last_update` bigint(20) DEFAULT NULL COMMENT '更新时间戳',
  `create_by` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建者',
  `create_date` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '更新者',
  `update_date` bigint(20) DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注信息',
  `del_flag` int(10) DEFAULT '0' COMMENT '逻辑删除标记（0：显示；1：隐藏）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='硬件-基站表';

