/*Table structure for table `ring_message` */

DROP TABLE IF EXISTS `ring_message`;

CREATE TABLE `ring_message` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '主键',
  `ring_mac` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '手环编号',
  `student_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学生id',
  `student_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学生姓名',
  `station_mac` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '基站mac',
  `location_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '基站名词-位置等',
  `balance` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '余额',
  `level` int(11) DEFAULT NULL COMMENT '电量',
  `version` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '版本号',
  `info_date` int(11) DEFAULT NULL COMMENT '数据的日期',
  `calories_day` int(11) DEFAULT '0' COMMENT '消耗的卡路里',
  `distance_day` int(11) DEFAULT '0' COMMENT '运动距离',
  `jog_day` int(11) DEFAULT '0' COMMENT '健步步数',
  `run_day` int(11) DEFAULT '0' COMMENT '跑步步数',
  `deep_sleep` int(11) DEFAULT '0' COMMENT '深度睡眠时间(min)',
  `shallow_sleep` int(11) DEFAULT '0' COMMENT '浅度睡眠(min)',
  `conscious_sleep` int(11) DEFAULT '0' COMMENT '意识睡眠(min)',
  `awake_time` int(11) DEFAULT '0' COMMENT '清醒时间(min)',
  `sleep_quality` float(11,2) DEFAULT '0.00' COMMENT '睡眠质量',
  `asleep_time` bigint(20) DEFAULT '0' COMMENT '入睡时间',
  `sport_time` int(11) DEFAULT '0' COMMENT '运动时间',
  `step_day` int(11) DEFAULT '0' COMMENT '总步数',
  `walk_day` int(11) DEFAULT '0' COMMENT '步行步数',
  `del_flag` int(11) DEFAULT '0' COMMENT '删除标志[0:未删除,1:已删除]',
  `create_date` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `last_update` bigint(20) DEFAULT NULL COMMENT '获取数据的时间',
  PRIMARY KEY (`id`),
  KEY `ringIndex` (`student_id`,`info_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

