/*Table structure for table `scan_log` */

DROP TABLE IF EXISTS `scan_log`;

CREATE TABLE `scan_log` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '主键ID',
  `mac` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '设备mac地址',
  `ring_num` int(10) DEFAULT NULL COMMENT '手环编号',
  `student_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学生ID',
  `student_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学生姓名',
  `station_mac` varchar(255) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT '基站mac',
  `station_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '基站位置，名称等',
  `ring_signal` int(10) DEFAULT NULL COMMENT '手环信号',
  `type` int(10) DEFAULT NULL COMMENT '基站类型【0扫描数据，1计算发送数据】',
  `heart_rate` int(20) DEFAULT NULL,
  `status` int(10) DEFAULT NULL COMMENT '设备状态[0:正常, 1:异常]',
  `last_update` bigint(20) DEFAULT NULL COMMENT '更新时间戳',
  `cycle` bigint(20) DEFAULT NULL COMMENT '当前数据所处周期',
  `remarks` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='扫描信息表';

