/*Table structure for table `score_mapping_rule` */

DROP TABLE IF EXISTS `score_mapping_rule`;

CREATE TABLE `score_mapping_rule` (
  `rule_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '规则id',
  `item_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '项目id',
  `item_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '项目名称',
  `school_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '机构id',
  `xd` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学段(1:小学 2 初中 3：高中)',
  `nj` int(20) DEFAULT NULL COMMENT '年级',
  `grade_name` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学段+年级名称(一年级,二年级..初一，初二...)',
  `gender` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '性别',
  `mark` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '成绩',
  `score` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '分数',
  `level` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '等级(1：优秀，2：良好 3：及格 4：不及格)',
  `create_time` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建人',
  `update_time` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '修改时间',
  `update_by` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '修改人',
  `del_flag` int(10) DEFAULT '0' COMMENT '逻辑删除标记',
  `remark` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备用字段(翻译字段)',
  `rule_type` int(10) DEFAULT '0' COMMENT '规则适用类型（0：体育测试，1：体质健康）',
  PRIMARY KEY (`rule_id`),
  KEY `ruleIndex` (`item_id`,`item_name`,`xd`,`nj`,`grade_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

