/*Table structure for table `user_student` */

DROP TABLE IF EXISTS `user_student`;

CREATE TABLE `user_student` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '主键',
  `school_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '结构ID[所属学校ID]',
  `class_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '班级ID',
  `student_account` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学生登录账号',
  `patriach_account` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '家长登录账号',
  `xsxm` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学生姓名',
  `xmpy` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '姓名拼音',
  `xszp` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学生照片地址',
  `phone` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '手机号码',
  `csrq` bigint(20) DEFAULT NULL COMMENT '出生日期',
  `rxrq` bigint(20) DEFAULT NULL COMMENT '入学年度',
  `xsxb` int(10) DEFAULT NULL COMMENT '性别【0位置，1男，2女】',
  `xstz` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学生身高',
  `xssg` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '身高',
  `xd` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学段[0幼儿园，1小学，2初中，3高中，4大学]',
  `nj` int(10) DEFAULT NULL COMMENT '年级编号',
  `bj` int(11) DEFAULT NULL COMMENT '班级ID',
  `xh` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学号',
  `xjh` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学籍号',
  `qgxjh` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '全国学籍号',
  `jyid` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '教育ID号',
  `syd` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '生源地',
  `yxzjlx` int(10) DEFAULT NULL COMMENT '有效证件类型[1身份证，2护照]',
  `yxzjh` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '有效证件号',
  `jbs` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '疾病史',
  `sfsbt` int(10) DEFAULT NULL COMMENT '是否是双胞胎',
  `sbtxh` int(10) DEFAULT NULL COMMENT '双胞胎序号',
  `xslb` int(10) DEFAULT NULL COMMENT '学生类别',
  `gb` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '国别',
  `mz` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '民族',
  `jg` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '籍贯',
  `zzmm` int(10) DEFAULT NULL COMMENT '政治面貌',
  `zslb` int(10) DEFAULT NULL COMMENT '招生类别',
  `lydq` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '来源地区',
  `hkszd` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '户口所在地',
  `xjzd` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '现居住址',
  `hkxz` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '户口性质',
  `sfbshk` int(10) DEFAULT NULL COMMENT '是否按本市户口学生对待',
  `status` int(10) DEFAULT NULL COMMENT '学生状态[0在籍正常，1在籍不在校，2在校不在籍，3不在籍不在校]',
  `del_flag` int(10) DEFAULT '0' COMMENT '逻辑删除标记（0：显示；1：隐藏）',
  `remarks` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注信息',
  `create_by` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建者',
  `create_date` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '更新者',
  `update_date` bigint(20) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `studentIndex` (`xh`,`class_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='学生管理';

