/*Table structure for table `user_teacher` */

DROP TABLE IF EXISTS `user_teacher`;

CREATE TABLE `user_teacher` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '主键ID',
  `school_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '机构ID',
  `department_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '部门ID',
  `name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '教师名',
  `quan_pin` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '姓名全拼',
  `gender` int(11) DEFAULT NULL COMMENT '性别',
  `identity` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '身份证号码',
  `account` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '教师登录账号',
  `is_manage` int(10) DEFAULT '0' COMMENT '是否是管理员[0不是，1是]',
  `title_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '职务ID-[职务管理]',
  `no` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '职工编号',
  `phone` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '联系电话',
  `mobile` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '手机号码',
  `email` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '邮箱',
  `start_work` bigint(20) DEFAULT NULL COMMENT '参加工作时间',
  `jszw` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '教师职务ID',
  `create_by` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建者',
  `create_date` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '更新者',
  `update_date` bigint(20) DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注信息',
  `del_flag` int(10) DEFAULT '0' COMMENT '逻辑删除标记（0：显示；1：隐藏）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='教师表：教育局、学校职工';

